import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';

const EventFormPage = () => {
  const navigate = useNavigate();
  const { id } = useParams();
  const isEditMode = id && id !== 'new';

  const [form, setForm] = useState({
    title: '',
    event_type: '',
    event_date: new Date().toISOString().split('.')[0],
    seats: 0
  });

  useEffect(() => {
    if (isEditMode) {
      // In a real app, this would fetch data from the API
      // For now, we'll simulate data for the given mock events
      if (id === '1') {
        setForm({
          title: 'Tech Conference 2025',
          event_type: 'Conference',
          event_date: '2025-07-15T09:00:00',
          seats: 200
        });
      } else if (id === '2') {
        setForm({
          title: 'Web Development Workshop',
          event_type: 'Workshop',
          event_date: '2025-08-10T14:00:00',
          seats: 30
        });
      } else if (id === '3') {
        setForm({
          title: 'Networking Meetup',
          event_type: 'Meetup',
          event_date: '2025-06-05T18:00:00',
          seats: 50
        });
      }
    }
  }, [id, isEditMode]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setForm({
      ...form,
      [name]: name === 'seats' ? parseInt(value) : value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(`Event ${isEditMode ? 'updated' : 'created'} successfully: ${JSON.stringify(form)}`);
    // In a real app, this would call the API
    navigate('/events');
  };

  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold mb-6">{isEditMode ? 'Edit Event' : 'Create New Event'}</h1>

      <form onSubmit={handleSubmit} className="bg-white rounded-lg shadow-md p-6">
        <div className="mb-4">
          <label htmlFor="title" className="block text-gray-700 font-bold mb-2">
            Event Title
          </label>
          <input
            type="text"
            id="title"
            name="title"
            value={form.title}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>

        <div className="mb-4">
          <label htmlFor="event_type" className="block text-gray-700 font-bold mb-2">
            Event Type
          </label>
          <select
            id="event_type"
            name="event_type"
            value={form.event_type}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          >
            <option value="">Select event type</option>
            <option value="Conference">Conference</option>
            <option value="Workshop">Workshop</option>
            <option value="Meetup">Meetup</option>
            <option value="Concert">Concert</option>
            <option value="Other">Other</option>
          </select>
        </div>

        <div className="mb-4">
          <label htmlFor="event_date" className="block text-gray-700 font-bold mb-2">
            Event Date and Time
          </label>
          <input
            type="datetime-local"
            id="event_date"
            name="event_date"
            value={form.event_date}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>

        <div className="mb-6">
          <label htmlFor="seats" className="block text-gray-700 font-bold mb-2">
            Number of Seats
          </label>
          <input
            type="number"
            id="seats"
            name="seats"
            value={form.seats}
            onChange={handleChange}
            min="1"
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            required
          />
        </div>

        <div className="flex justify-between">
          <button
            type="button"
            onClick={() => navigate('/events')}
            className="bg-gray-500 hover:bg-gray-600 text-white py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          >
            Cancel
          </button>
          <button
            type="submit"
            className="bg-blue-500 hover:bg-blue-600 text-white py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          >
            {isEditMode ? 'Update Event' : 'Create Event'}
          </button>
        </div>
      </form>
    </div>
  );
};

export default EventFormPage;
